import React, {useState} from 'react';
import {
  BrowserRouter as Router,
  Switch,
  Route
} from "react-router-dom";
import Home from './pages/Home';
import Song from './pages/Song';

function App() {
  const [userSign, setUserSign] = useState();

  return (
    <Router>
    <div className="App">
      <Switch>
        <Route path="/Song" userSign={userSign} component={Song} />
        <Route exact path="/" setUserSign={setUserSign} userSign={userSign} component={Home} />
      </Switch>
    </div>
    </Router>
  );
}

export default App;
